profiledesc.descrules:
Deze toegang is vervaardigd met inachtneming van de volgende richtlijnen: 

          Leidraad bij de lessen in het ordenen en beschrijven van archieven, geheel herziene editie, Stichting Archiefschool, 's-Gravenhage 1983;

          Lexicon der Nederlandse Archieftermen, Stichting Archiefpublikaties, 's-Gravenhage 1983.

bioghist.p:
Afdeling I


controle van de uitgaven der Nationale Schuld;

onderzoek en verevening van alle schuldverordeningen ten laste van het Rijk;

onderzoek der afrekeningen van de korpsen der landmacht en van het korps mariniers wegens betaalde traktementen der officieren, soldijen der onderofficieren en manschappen;

onderzoek der afrekeningen van H.M. Schepen van oorlog wegens daarop verdiende zeetraktementen;

onderzoek en beoordeling van alle verantwoordingen wegens verstrekte gelden ter goede rekening op de rijksbegroting;

het dagelijks bijhouden der Grootboeken van de Nationale Schuld, het opmaken van de maandelijkse balansen, het bijhouden der saldo-registers tot verificatie der renten, de controle van de schuldbekentenissen ten laste van het Rijk komende en van de uitkeringen.

Afdeling II


controle van de rijksontvangsten van van het kasbeheer van rekenplichtigen, onderzoek ter plaatse behalve dat van de rijksbedrijven;

controle zowel in de bureaus als ter plaatse op de rijksontvangsten, op het kasbeheer van rekenplichtigen en op de in 's Rijks kas gedeponeerde fondsen;

onderzoek en beoordeling van alle rekeningen van de departementen van Algemeen Bestuur, van De Nederlandsche Bank, van de comptabele agent der wissels bij het Departement van Defensie en van alle personen die gelden of geldswaarden aan het Rijk toebehoren beheren, of onder zich hebben, alsmede van de rekeningen wegens het beheer van provinciale fondsen;

toezicht op het beheer van het materiaal in de rijksmagazijnen, arsenalen, werven en hospitalen.

Afdeling III


controle der rijksbedrijven, hoofdzakelijk ter plaatse;

controle op de bedrijven waarop artikel 88 van de Comptabiliteitswet 1928 van toepassing is;

bovenstaande controle omvat de volgende bedrijven: de Algemene Landsdrukkerij, 's Rijks Munt, het Vissershavenbedrijf, het Staatsbedrijf der Posterijen, Telegrafie en Telefonie, de Staatsmijnen in Limburg en de Artillerie-inrichtingen.

Afdeling IV


controle van de ontvangsten en uitgaven in Nederland van Oost-Indië, Suriname en Curacao;

controle van de traktementen van de Burgerlijke Rijksambtenaren;

controle der pensioenen en gagementen ten laste van het Rijk;

controle op de uitgaven en ontvangsten betreffende Nederlandsch-Indië, Suriname en Curaçao;

onderzoek naar de begrotingsrekeningen en van de rekeningen van het Departement van Koloniën met de koloniën;

de afrekeningen van het koloniaal werfdepot, de koloniale reserve en het Koninklijk Koloniaal Militair Invalidenhuis Bronbeek;

de verantwoordingen wegens gelden ter goede afrekening;

controle op verleende voorschotten;

controle op de toepassing van het Bezoldigingsbesluit Burgerlijke Rijksambtenaren.

Bureau Archief



beheer van het archief;

index op inkomende en uitgaande stukken.

