Afdeling I


controle op de uitgaven en ontvangsten der Departementen van Binnenlandse Zaken, van Handel, Nijverheid en Scheepvaart, van Sociale Zaken en van het Afwikkelingsbureau van het Departement van Defensie;

bovenstaande met uitzondering van de traktementen, geregeld in het Bezoldigingsbesluit Burgerlijke Rijksambtenaren en van de pensioenen;

controle op het geldelijk beheer van de Algemeene Landsdrukkerij.

Afdeling II


controle op de uitgaven en ontvangsten der Departementen van Buitenlandse Zaken, van Justitie, van Opvoeding, Wetenschap en Kultuurbescherming, van Volksvoorlichting en Kunsten, van Waterstaat en van Koloniën, met inbegrip van die voor Nederlandsch-Indië voor zover begrepen in het eerste en derde hoofdstuk der begroting voor die gewesten, alsmede voor Suriname en Curaçao;

controle op de traktementen, geregeld in het Bezoldigingsbesluit Burgerlijke Rijksambtenaren en van de pensioenen.

Afdeling III


controle op de uitgaven en ontvangsten der Departementen van Financiën en van Algemene Zaken, van de Arbeidsdienst en van de dienst van de Wederopbouw;

