controle op de uitgaven en ontvangsten van de Staatsbedrijven (behalve van de Algemene Landsdrukkerij) en van de Pensioenraad.

Afdeling IV


controle op de uitgaven en ontvangsten der Departementen van Landbouw en Visserij;

bovenstaande met uitzondering van de traktementen, geregeld in het Bezoldigingsbesluit Burgerlijke Rijksambtenaren en van de pensioenen.

